import React from 'react';
import Viewer from './Containers/Viewer';
import { Provider } from 'react-redux';
import { store } from './redux/store';

import './App.css';

const App = () => {
  return (
    <Provider store={store}>
      <div style={{backgroundColor: 'black'}}>
        <Viewer />
      </div>
    </Provider>
  );
}

export default App;
